import React from 'react';
import logo from './logo.svg';
import './App.css';

import Word from './components/Word';
import Hangman from './components/Hangman';
import Letters from './components/Letters';

function App() {
  return (
    <div className="App">
      <h4>Hangman</h4>
      <Word />
      <Hangman />
      <Letters />
    </div>
  );
}

export default App;
